PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX schema: <http://schema.org/>

SELECT ?location ?labelLocation 
       ?landmarkLocation ?labelLandmarkLocation 
       ?author ?labelAuthor ?architect ?labelArchitect ?founder ?labelFounder ?discoverer ?labelDiscoverer
       ?date ?historicalPeriod ?historicalPeriodLabel
       ?culturalMovement ?culturalMovementLabel 
       ?architecturalStyle ?architecturalStyleLabel
WHERE {
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P131 ?location.
        ?location rdfs:label ?labelLocation.
        filter(lang(?labelLocation) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P276 ?landmarkLocation.
        ?landmarkLocation rdfs:label ?labelLandmarkLocation.
        filter(lang(?labelLandmarkLocation) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> (wdt:P170 | wdt:P50 | wdt:P1779) ?author.
        ?author rdfs:label ?labelAuthor.
        filter(lang(?labelAuthor) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P84 ?architect.
        ?architect rdfs:label ?labelArchitect.
        filter(lang(?labelArchitect) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P112 ?founder.
        ?founder rdfs:label ?labelFounder.
        filter(lang(?labelFounder) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P61 ?discoverer.
        ?discoverer rdfs:label ?labelDiscoverer.
        filter(lang(?labelDiscoverer) = 'it')
    }
    optional {
        <http://www.wikidata.org/entity/Q20264735> wdt:P571 ?date.
    }
    optional { 
        <http://www.wikidata.org/entity/Q20264735> (wdt:P135 | wdt:P136) ?culturalMovement. 
        ?culturalMovement rdfs:label ?culturalMovementLabel.
        filter(lang(?culturalMovementLabel) = 'it')
    }
    optional { 
        <http://www.wikidata.org/entity/Q20264735> (wdt:P2348) ?historicalPeriod. 
        ?historicalPeriod rdfs:label ?historicalPeriodLabel.
        filter(lang(?historicalPeriodLabel) = 'it')
    }
    optional { 
        <http://www.wikidata.org/entity/Q20264735> (wdt:P149) ?architecturalStyle. 
        ?architecturalStyle rdfs:label ?architecturalStyleLabel.
        filter(lang(?architecturalStyleLabel) = 'it')
    }
}

select  *
where{ wd:Q2266226 wdt:P735 ?x. 
?x wdt:P279* wd:Q579371}

PREFIX wd: <http://www.wikidata.org/entity/>
PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX schema: <http://schema.org/>

select ?location ?labelLocation ?parentLocation
where {
  wd:Q16029 wdt:P131* ?location.
  optional {
    ?location wdt:P131 ?parentLocation.
  }
  ?location rdfs:label ?labelLocation.
  filter(lang(?labelLocation) = 'it')    
} group by ?location ?labelLocation ?parentLocation
order by ?depth

SELECT DISTINCT ?wikidata_id
       WHERE {
         ?wikidata_id wdt:P31 wd:Q7187 ;
                      wdt:P703 ?species .
         VALUES (?species) { (wd:Q15978631) (wd:Q83310) (wd:Q184224) } .
         ?wikidata_id rdfs:label "Shh"@en .
         }

select ?c_reviewLabel ?m_reviewLabel ?dateLabel
where
{
	BIND(wd:Q17064227 as ?entity)
	OPTIONAL{?entity p:P444 ?c_review.
	       ?c_review ps:P444 ?c_reviewLabel.
	       ?c_review pq:P459 wd:Q108403393}
	OPTIONAL{?entity p:P444 ?m_review.
	       ?m_review ps:P444 ?m_reviewLabel.
	       ?m_review pq:P459 wd:Q108403540}
	OPTIONAL{?entity p:P577 ?date.
	       ?date ps:P577 ?dateLabel.
	       ?date pq:P291 wd:Q30}
  }

SELECT (COUNT(DISTINCT ?item) AS ?count) WHERE {
  hint:Query hint:optimizer "Static";
    hint:maxParallel 100 ;
    hint:chunkSize 1024 ;
    hint:queryEngineChunkHandler "Native".
  ?item (wdt:P27|wdt:P17|wdt:P495|wdt:P1532|(wdt:P19/wdt:P17)) ?country.
  VALUES ?country {
    wd:Q30
  }
  ?item wdt:P21 wd:Q6581097;
    wdt:P31 wd:Q5;
    wikibase:sitelinks ?sitelinks.
  FILTER(?sitelinks >= 1 )
  FILTER(EXISTS {
    ?w schema:about ?item;
      schema:isPartOf <https://en.wikipedia.org/>.
  })
}

SELECT ?sibling ?siblingLabel ?siblingDescription ?type 
(GROUP_CONCAT(DISTINCT(?partOf); separator = ", ") AS ?partOf_list)
(GROUP_CONCAT(DISTINCT(?partiallyCoincidentWith); separator = ", ") AS ?partiallyCoincidentWith_list)
WHERE {
  {
  SELECT ?sibling ?partOf ?partiallyCoincidentWith ("P31" AS ?type) WHERE
    {
      wd:Q49757 wdt:P31 ?subjectType.
      ?sibling  wdt:P31 ?subjectType.
      OPTIONAL {?sibling wdt:P361 ?partOf.}
      OPTIONAL {?sibling wdt:P1382 ?partiallyCoincidentWith.}
      FILTER ( NOT EXISTS { ?sibling  wdt:P1382 wd:Q49757  } )
      FILTER ( NOT EXISTS { ?sibling  wdt:P361 wd:Q49757  } )

      FILTER (NOT EXISTS {?sibling wdt:P279 wd:Q864503})
      FILTER (NOT EXISTS {wd:Q864503 wdt:P279 ?sibling})

            FILTER ( NOT EXISTS { 
          wd:Q3611 ?relationToMain wd:Q49757. # do not have the same relation to main      
          wd:Q3611 ?relationToMain ?sibling 
                          } )  # do not have the same relation to main

          VALUES ?siblingClass { wd:Q49757 wd:Q11774202 wd:Q6625963 wd:Q15949613 wd:Q4853732 wd:Q36180 wd:Q753110 wd:Q23436 wd:Q548806 wd:Q3066501 wd:Q325068 wd:Q174193 wd:Q145 wd:Q7845823 wd:Q160302 wd:Q5 wd:Q424325 wd:Q185118 wd:Q2349094 wd:Q217352 wd:Q4655846 wd:Q2068990 wd:Q4927937 wd:Q99348900 wd:Q602358 wd:Q19180675 wd:Q17378135 wd:Q15987216 wd:Q867541 wd:Q2657718 wd:Q51955019 wd:Q67311526 wd:Q4532138 wd:Q41981607 wd:Q104788952 wd:Q3181656 wd:Q19098835 wd:Q20968044 wd:Q24568958 wd:Q72941560 wd:Q5671855 wd:Q47518588 wd:Q319226 wd:Q19715429 wd:Q9327 wd:Q5686 wd:Q16867 wd:Q69339 wd:Q3322165 wd:Q181634 wd:Q1368943 wd:Q1860 wd:Q6581097 wd:Q3739104 wd:Q590710 wd:Q170478 wd:Q162126 wd:Q1860 wd:Q101246526 wd:Q71887839 wd:Q964233 wd:Q1860 wd:Q415027 wd:Q924335}
      FILTER (NOT EXISTS {?sibling  wdt:P279 ?siblingClass})
      FILTER (NOT EXISTS {?siblingClass wdt:P279 ?sibling})

      FILTER (NOT EXISTS{
        hint:Query hint:optimizer "None".
        ?stmt ?hasToDoWith wd:Q1512.
        ?stmt  ?relate wd:Q49757.
        ?stmt ?relate ?sibling.       
      })

    }
    LIMIT 1000
  }

  UNION

  {
  SELECT DISTINCT ?sibling ?partOf ?partiallyCoincidentWith ("P279" AS ?type) WHERE
    {
      wd:Q49757 wdt:P279 ?subjectType.
      ?sibling  wdt:P279 ?subjectType.
      OPTIONAL {?sibling wdt:P361 ?partOf.}
      OPTIONAL {?sibling wdt:P1382 ?partiallyCoincidentWith.}

      FILTER ( NOT EXISTS { ?sibling  wdt:P1382 wd:Q49757  } )
      FILTER ( NOT EXISTS { ?sibling  wdt:P361 wd:Q49757  } )

      FILTER (NOT EXISTS {?sibling wdt:P279 wd:Q864503})
      FILTER (NOT EXISTS {wd:Q864503 wdt:P279 ?sibling})

            FILTER ( NOT EXISTS { 
          wd:Q3611 ?relationToMain wd:Q49757. # do not have the same relation to main      
          wd:Q3611 ?relationToMain ?sibling 
                          } )  # do not have the same relation to main

          VALUES ?siblingClass { wd:Q49757 wd:Q11774202 wd:Q6625963 wd:Q15949613 wd:Q4853732 wd:Q36180 wd:Q753110 wd:Q23436 wd:Q548806 wd:Q3066501 wd:Q325068 wd:Q174193 wd:Q145 wd:Q7845823 wd:Q160302 wd:Q5 wd:Q424325 wd:Q185118 wd:Q2349094 wd:Q217352 wd:Q4655846 wd:Q2068990 wd:Q4927937 wd:Q99348900 wd:Q602358 wd:Q19180675 wd:Q17378135 wd:Q15987216 wd:Q867541 wd:Q2657718 wd:Q51955019 wd:Q67311526 wd:Q4532138 wd:Q41981607 wd:Q104788952 wd:Q3181656 wd:Q19098835 wd:Q20968044 wd:Q24568958 wd:Q72941560 wd:Q5671855 wd:Q47518588 wd:Q319226 wd:Q19715429 wd:Q9327 wd:Q5686 wd:Q16867 wd:Q69339 wd:Q3322165 wd:Q181634 wd:Q1368943 wd:Q1860 wd:Q6581097 wd:Q3739104 wd:Q590710 wd:Q170478 wd:Q162126 wd:Q1860 wd:Q101246526 wd:Q71887839 wd:Q964233 wd:Q1860 wd:Q415027 wd:Q924335}
      FILTER (NOT EXISTS {?sibling  wdt:P279 ?siblingClass})
      FILTER (NOT EXISTS {?siblingClass wdt:P279 ?sibling})

      FILTER (NOT EXISTS{
        hint:Query hint:optimizer "None".
        ?stmt ?hasToDoWith wd:Q1512.
        ?stmt  ?relate wd:Q49757.
        ?stmt ?relate ?sibling.       
      })

    }
    LIMIT 1000
  }
SERVICE wikibase:label { bd:serviceParam wikibase:language "en". }
}
GROUP BY ?sibling ?siblingLabel ?siblingDescription ?type
LIMIT 1000

SELECT DISTINCT ?place ?placeLabel ?placeDescription (MIN(?typeLabel) as ?mainType) (MIN(?location) as ?coordinates) ?sitelinks  WHERE {

VALUES ?additionalareas {wd:Q527676 wd:Q163948 wd:Q163948 wd:Q175129 wd:Q163948 wd:Q245546 wd:Q175129 wd:Q259463 wd:Q3348 wd:Q3366 wd:Q3344 wd:Q3360 wd:Q3344 wd:Q3366 wd:Q3344 wd:Q3363 wd:Q3360 wd:Q3337 wd:Q3344 wd:Q3348 wd:Q238661 wd:Q223135 wd:Q169256 wd:Q245537 wd:Q270211 wd:Q187112 wd:Q270211 wd:Q270211 wd:Q187112 wd:Q238661 wd:Q209524 wd:Q169256 wd:Q161732 wd:Q238661 wd:Q230094 wd:Q259408 wd:Q270211 wd:Q238661} 

 ?article schema:about ?place;
    schema:isPartOf <https://fr.wikipedia.org/>.
  SERVICE wikibase:around {
    ?place wdt:P625 ?location.

    bd:serviceParam wikibase:center "Point(0.718444 47.4251)"^^geo:wktLiteral;
      wikibase:radius "2".
  }

  ?place schema:description ?placeDescription .
  FILTER(!STRSTARTS(lcase(?placeDescription), "ancien")) .
  ?place wdt:P31 ?type .
  FILTER ( ?type not in ( wd:Q3882219,wd:Q1190554,wd:Q1139665,wd:Q207934,wd:Q79007,wd:Q702842,wd:Q87542664,wd:Q13634881,wd:Q703941,wd:Q25917186,wd:Q21480300,wd:Q18493502,wd:Q4676786,wd:Q1371150,wd:Q3199915,wd:Q3307578 ) ) .
  ?place wdt:P131 ?additionalareas .
  ?place wikibase:sitelinks ?sitelinks.
  FILTER (?sitelinks > 1) 
  BIND(geof:distance("Point(0.718444 47.4251)"^^geo:wktLiteral, ?location) AS ?dist)
  MINUS {
    ?place wdt:P576 ?dissolvedDate 
  }
  MINUS {
    ?place wdt:P5816 wd:Q56556915 
  }
  MINUS {
    ?place wdt:P3999 ?closeDate 
  }
  FILTER(EXISTS {
    ?place schema:description ?placeDescription.
    FILTER(LANG(?placeDescription) = "fr")
  })
  SERVICE wikibase:label { 
    ?type rdfs:label ?typeLabel .
    ?place rdfs:label ?placeLabel .
    bd:serviceParam wikibase:language "fr". 
  }
}

GROUP BY ?place ?placeLabel ?placeDescription ?sitelinks 

order by desc(?sitelinks)
LIMIT 50

SELECT DISTINCT ?wikidata_id
       WHERE {
         ?wikidata_id wdt:P31 wd:Q7187 ;
                      wdt:P703 ?species .
         VALUES (?species) { (wd:Q15978631) (wd:Q83310) (wd:Q184224) } .
         ?wikidata_id rdfs:label "Shh"@en .
         }

SELECT DISTINCT ?item ?itemLabel
WHERE {
  # Use the wikibase:label service to extract labels for all entities,
  # based on the local language if found, or English.
  SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }.
  {
    SELECT DISTINCT ?item (SAMPLE(?matchingType) AS ?sampleMatchingType) (MIN(?num) AS ?rank) {
      SERVICE wikibase:mwapi {
        bd:serviceParam wikibase:api "EntitySearch".
        bd:serviceParam wikibase:endpoint "www.wikidata.org".
        bd:serviceParam mwapi:search "17".
        bd:serviceParam mwapi:language "fr".
        ?item wikibase:apiOutputItem mwapi:item.
        ?num wikibase:apiOrdinal true.
      }
      # Define the set of accepted types.
      VALUES ?acceptedTypes {
        wd:Q33999 wd:Q11424 wd:Q483501 wd:Q215380 wd:Q482994
      }
      ?item wdt:P106|wdt:P31 ?type.
      # Match (any superclass of) type against accepted types.
      OPTIONAL {
        ?item wdt:P106|wdt:P31 ?matchingType.
        ?matchingType wdt:P279* ?acceptedTypes.
      }
    }
    GROUP BY ?item
    ORDER BY ?rank
    LIMIT 2
  }
  FILTER (BOUND(?sampleMatchingType) && ?rank <= 2)
}
ORDER BY ?rank
LIMIT 1

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
                       PREFIX schema: <http://schema.org/>

                       SELECT DISTINCT ?item ?IMDb_ID ?Freebase_ID ?sitelink ?publication_dateLabel ?genreLabel ?country_of_originLabel ?original_language_of_workLabel ?number_of_seasons ?number_of_episodes ?start_time WHERE {
                         ?item wdt:P31/wdt:P279* wd:Q11424.

                         SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
                         OPTIONAL { ?item wdt:P345 ?IMDb_ID. }
                         OPTIONAL { ?item wdt:P646 ?Freebase_ID. }
                         ?sitelink schema:about ?item.
                         ?sitelink schema:inLanguage "de".
                         ?sitelink schema:isPartOf <https://de.wikipedia.org/>.
                         OPTIONAL { ?item wdt:P577  ?publication_date. }
                         OPTIONAL { ?item wdt:P136  ?genre. }
                         OPTIONAL { ?item wdt:P495  ?country_of_origin. }
                         OPTIONAL { ?item wdt:P364  ?original_language_of_work. }
                         OPTIONAL { ?item wdt:P2437 ?number_of_seasons. }
                         OPTIONAL { ?item wdt:P1113 ?number_of_episodes. }
                         OPTIONAL { ?item wdt:P580 ?start_time. }
                         #FILTER(BOUND(?IMDb_ID))  ## filter anything that has an IMDB
                # FILTER(BOUND(?publication_date))
                FILTER((?publication_date >= "2003-01-01T00:00:00Z"^^xsd:dateTime) && (?publication_date <= "2003-06-30T00:00:00Z"^^xsd:dateTime)||(?start_time >= "2003-01-01T00:00:00Z"^^xsd:dateTime) && (?start_time <= "2003-06-30T00:00:00Z"^^xsd:dateTime))
               }

PREFIX  dbo:  <http://dbpedia.org/ontology/>
PREFIX  schema: <http://schema.org/>
PREFIX  bd:   <http://www.bigdata.com/rdf#>
PREFIX  owl:  <http://www.w3.org/2002/07/owl#>
PREFIX  wdt:  <http://www.wikidata.org/prop/direct/>
PREFIX  wikibase: <http://wikiba.se/ontology#>
PREFIX  rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX  wd:   <http://www.wikidata.org/entity/>

SELECT  ?agentDescription ?givenNameLabel ?language ?article ?image ?birthplace ?birthplaceLabel ?deathplace ?deathplaceLabel ?sexLabel ?nationalityLabel
WHERE
  { ?agent  wdt:P2799  "84798"
    OPTIONAL
      { ?agent  wdt:P20  ?deathplace }
    OPTIONAL
      { ?agent  wdt:P19  ?birthplace }
    OPTIONAL
      { ?agent  wdt:P103  ?language }
    OPTIONAL
      { ?agent  wdt:P18  ?image }
    OPTIONAL
      { ?agent  wdt:P27  ?nationality }
    OPTIONAL
      { ?agent  wdt:P21  ?sex }
    OPTIONAL
      { ?agent  wdt:P735  ?givenName }
    OPTIONAL
      { ?agent    wdt:P106    ?occupation .
        ?occupation  rdfs:label  ?occupationlbl
        FILTER langMatches(lang(?occupationlbl), "es")
      }
    OPTIONAL
      { ?article  schema:about       ?agent ;
                  schema:inLanguage  "es" ;
                  schema:isPartOf    <https://es.wikipedia.org/>
      }
    SERVICE wikibase:label
      { bd:serviceParam
                  wikibase:language  "es"
      }
  }
LIMIT   5

PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
                       PREFIX schema: <http://schema.org/>

                       SELECT DISTINCT ?item ?IMDb_ID ?Freebase_ID ?sitelink ?publication_dateLabel ?genreLabel ?country_of_originLabel ?original_language_of_workLabel ?number_of_seasons ?number_of_episodes ?start_time WHERE {
                         ?item wdt:P31/wdt:P279* wd:Q11424.

                         SERVICE wikibase:label { bd:serviceParam wikibase:language "[AUTO_LANGUAGE],en". }
                         OPTIONAL { ?item wdt:P345 ?IMDb_ID. }
                         OPTIONAL { ?item wdt:P646 ?Freebase_ID. }
                         ?sitelink schema:about ?item.
                         ?sitelink schema:inLanguage "en".
                         ?sitelink schema:isPartOf <https://en.wikipedia.org/>.
                         OPTIONAL { ?item wdt:P577  ?publication_date. }
                         OPTIONAL { ?item wdt:P136  ?genre. }
                         OPTIONAL { ?item wdt:P495  ?country_of_origin. }
                         OPTIONAL { ?item wdt:P364  ?original_language_of_work. }
                         OPTIONAL { ?item wdt:P2437 ?number_of_seasons. }
                         OPTIONAL { ?item wdt:P1113 ?number_of_episodes. }
                         OPTIONAL { ?item wdt:P580 ?start_time. }
                         FILTER(BOUND(?IMDb_ID))  ## filter anything that has an IMDB
                # FILTER(BOUND(?publication_date))
                FILTER((?publication_date >= "2022-01-01T00:00:00Z"^^xsd:dateTime) && (?publication_date <= "2022-06-30T00:00:00Z"^^xsd:dateTime)||(?start_time >= "2022-01-01T00:00:00Z"^^xsd:dateTime) && (?start_time <= "2022-06-30T00:00:00Z"^^xsd:dateTime))
               }
